import "../../css/Main.css";
import { lg_api } from "../../__modules__";
import {
  BsHouse,
  BsBoxArrowRight,
  BsPersonCircle,
  BsChatLeft,
  BsInstagram,
  BsSearch,
} from "react-icons/bs";
import { useEffect, useState } from "react";

function HeadMenu() {
  const [profile, setProfile] = useState("");

  async function getProfile(e) {
    // Get user.
    const user_id = document.cookie
      .split(";")
      .find((e) => e.startsWith("user_id="))
      .split("=")[1];

    const { data } = await lg_api("accounts/profile-router/profile-router/", {
      params: {
        user_id: user_id,
      },
    });
  }

  getProfile();
  return (
    <div className="App">
      <header className="header">
        <nav className="navbar navbar-expand-lg bg-light">
          <div className="container-fluid">
            <div className="container-logo-link grid">
              <BsInstagram className="icon-gral" />
              <h1 className="fs-title">Lazygram</h1>
            </div>
            <div
              className="collapse navbar-collapse"
              id="navbarSupportedContent"
            >
              <ul className="navbar-nav mx-auto mb-2 mb-lg-0">
                {/* MD */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsChatLeft className="icon-gral" />
                  </span>
                </li>
                {/* Search */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsSearch className="icon-gral" />
                  </span>
                </li>
                {/* Home */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsHouse className="icon-gral" />
                  </span>
                </li>
                {/* User */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsPersonCircle className="icon-gral" />
                  </span>
                </li>
                {/* Logout */}
                <li className="nav-item">
                  <span className="nav-link container-icons-link">
                    <BsBoxArrowRight className="icon-gral" />
                  </span>
                </li>
              </ul>
            </div>
          </div>
        </nav>
      </header>
    </div>
  );
}

export { HeadMenu };
